// SPDX-License-Identifier: agpl-3.0
pragma solidity 0.6.12;

contract ContractA {
    address public owner;
    uint256 public balance;

    constructor() public {
        owner = msg.sender;
    }

    receive() external payable {
        balance = balance + msg.value;
    }

    function receivesETH() public payable {
        balance = balance + msg.value;
    }
}
